<head>
    <link rel="stylesheet" type="text/css" href="http://spoqa.github.io/spoqa-han-sans/css/SpoqaHanSansNeo.css"/>
    <link rel="icon" type="image/png" href="https://cdn.imweb.me/upload/S202109149e2382371ba2e/a7ca44b559b87.png"/>
    <title>GNBO견적서 다운받기</title>
    <style>
        * {
            font-family: "Spoqa Han Sans Neo", "Spoqa Han Sans JP", sans-serif;
        }

        h2 {
            color: #0028ce;
            font-size: 26px;
            letter-spacing: -2px;
        }

        /* 견적서 저장 버튼 */
        button {
            font-size: 18px;
            border-radius: 100px;
            background-color: #0028ce;
            color: #ffffff;
            border: #0028ce 1px solid;
            padding: 8px 70px;
            letter-spacing: -1px;
            cursor: pointer;
        }

        .fpopup__content__save {
            margin-top: 12px;
        }

        /* 상호명 입력칸 스타일 */
        .fpopup__content__name {
            margin-top: 20px;
            padding: 9px;
            width: 248px;
            border-radius: 3px;
            border: #bdbdbd 1px solid;
            font-size: 16px;
        }

        /* 박스 스타일 */
        .fpopup {
            background-color: #ffffff;
            border-radius: 10px;
        }

        .fpopup__content__type {
            font-size: 14px;
            margin-top: 12px;
            margin-bottom: 12px;
            letter-spacing: -0.5px;
            font-family: "Spoqa Han Sans Neo";
        }

        .fpopup__content__row fpopup__content__row--vertical {
            margin-left: 30px;
        }

        * {
            box-sizing: border-box;
        }

        html, body {
            width: 100%;
            height: 100%;
            margin: 0;
            padding: 0;
        }

        .fpopup_wrap {
            position: absolute;
            width: 100%;
            height: 100%;
            top: 0;
            left: 0;
            overflow: hidden;
            display: none;
            justify-content: center;
            align-items: center;
        }

        .fpopup_wrap--open {
            display: flex;
        }

        .fpopup {
            padding: 16px;
            z-index: 1;
            border-radius: 5px;
        }

        .fpopup__header {
            width: 100%;
            padding: 0 0 0.5rem 0;
            display: flex;
            flex-direction: row;
        }

        .fpopup__header__title {
            margin-bottom: 12px;
            flex: 1 0 0;
            font-size: 40px;
            text-align: center;
        }

        .fpopup__header__close {
            flex: 0 0 auto;
            font-size: 20px;
            cursor: pointer;
            user-select: none;
        }

        .fpopup__content {
            display: flex;
            flex-direction: column;
            align-items: center;
        }

        .fpopup__content__row {
            margin: 0 0 1rem 0;
        }

        .menu_box {
            display: flex;
            margin-bottom: 20px;
        }

        .popup_menu {
            background-color: #f0f0f0;
            color: #adadad;
            cursor: pointer;
            padding: 10px 12px;
            margin: 2px;
            font-size: 14px;
        }

        .active_menu {
            background-color: #0028ce;
            color: white;
        }

        .select-menus {
            display: none;
        }

        .active_inputs {
            display: block;
        }
    </style>
    <script type="text/javascript" src="https://cdnjs.cloudflare.com/ajax/libs/jspdf/2.5.1/jspdf.umd.min.js"></script>
</head>
<body>

                        <!-- <button class="fpopup__content__print">견적서 프린트</button> -->
                    </div>
                </div>
            </div>

        <script type="text/javascript">
            document.addEventListener("DOMContentLoaded", async function() {
                async function imageToBase64(url) {
                    try {
                        const response = await fetch(url)
                        const blob = await response.blob()
                        const reader = new FileReader()

                        return new Promise((resolve,reject)=>{
                            reader.onloadend = ()=>{
                                resolve(reader.result)
                            }
                            reader.onerror = reject
                            reader.readAsDataURL(blob)
                        }
                        )
                    } catch (error) {
                        console.error("Error converting image to Base64:", error)
                    }
                }

                    return year + "년 " + month + "월 " + day + "일"
                }

                    const year = date.getFullYear()
                    const month = date.getMonth() + 1
                    const day = date.getDate()
                    return year + "-" + month + "-" + day + " GNBO 견적서.pdf"
                }

                    }

                }

                const init = ()=>{

                        return setTimeout(init, 1000)
                    }

                    handleEvent()

                    console.debug("스크립트 초기화 완료")
                }

                init()

                const popupMenus = document.querySelectorAll(".popup_menu")

                // 각각의 popup_menu에 대해 클릭 이벤트 리스너 등록
                popupMenus.forEach((menu,menuIndex)=>{
                    menu.addEventListener("click", function(event) {
                        // 클릭된 요소에만 active 클래스 추가
                        popupMenus.forEach((menu,index)=>{
                            menu.classList.remove("active_menu")
                            if (menuIndex === index)
                                inputMenus[index].classList.add("active_inputs")
                            else
                                inputMenus[index].classList.remove("active_inputs")
                        }
                        )
                        event.target.classList.add("active_menu")
                    })
                }
